import React, { useState } from "react";
import Navbar from "@material-tailwind/react/Navbar";
import NavbarContainer from "@material-tailwind/react/NavbarContainer";
import NavbarWrapper from "@material-tailwind/react/NavbarWrapper";
import NavbarBrand from "@material-tailwind/react/NavbarBrand";
import NavbarToggler from "@material-tailwind/react/NavbarToggler";
import NavbarCollapse from "@material-tailwind/react/NavbarCollapse";
import Nav from "@material-tailwind/react/Nav";
import NavLink from "@material-tailwind/react/NavLink";
import NavbarInput from "@material-tailwind/react/NavbarInput";
import Icon from "@material-tailwind/react/Icon";
import DescriptionIcon from "@material-ui/icons/Description";
// import MailIcon from "@material-ui/icons/Mail";


export default function BarNav({onSubmit}) {
  const [openNavbar, setOpenNavbar] = useState(false);
  const [keyWord, setKeyWord] = useState('');
  const handleKeyWordChange = (e)=>{
    setKeyWord(e.target.value);
    console.log(e.target.value)
  };
  const handlePress = (e)=>{
    if(e.charCode === 13){
      setKeyWord(e.target.value);
      console.log(keyWord)
  };}

  return (
    <Navbar color="lightGreen" navbar>
      <NavbarContainer>
        <NavbarWrapper>
          <NavbarBrand>Nha Vy who?</NavbarBrand>
          <NavbarToggler
            color="white"
            onClick={() => setOpenNavbar(!openNavbar)}
            ripple="light"
          />
        </NavbarWrapper>

        <NavbarCollapse open={openNavbar}>
          <Nav leftSide>
            <NavLink href="/portfolio" ripple="light">

                <DescriptionIcon />
                Portfolio

            </NavLink>
            <NavLink href="/" ripple="light">
              <Icon name="account_circle" size="xl" />
              about me
            </NavLink>
            {/* <NavLink href="/contact">
              <NavItem ripple="light">
                <MailIcon />
                Contact
              </NavItem>
            </NavLink> */}
          </Nav>
          <NavbarInput type="text" placeholder="Search here" value={keyWord} onChange={handleKeyWordChange} onKeyPress={handlePress} />

        </NavbarCollapse>
      </NavbarContainer>
    </Navbar>
  );
}
